'''Raw karambwan''' are a [[fish|mollusk]] native to the tropical island of [[Karamja]]. Catching one requires 65 [[Fishing]] and a [[karambwan vessel]] using [[raw karambwanji]] as bait after completing the [[Tai Bwo Wannai Trio]] [[quest]]. Each catch yields 50 Fishing [[experience]]. The karambwan [[Fishing spot (karambwan)|fishing spot]]s are north of the [[Ship Yard]] and east of the [[harpie bug swarm]]s at [[fairy ring]] code {{Fairycode|dkp}}.

Unlike regular [[Fishing]], karambwan may steal karambwanji from the vessel '''without''' catch. When this occurs, a filtered game message will state ''A Karambwan deftly snatches the Karambwanji from your vessel!'' The rate of occurrence is the inverse of the fishing chance graph below.

To be able to cook a karambwan thoroughly, players must speak to [[Tinsay]]<!--DO NOT CHANGE. See Cooked karambwan's talk page for proof--> in his hut after completing the [[Tai Bwo Wannai Trio]] [[quest]]. When using a raw karambwan on a [[fire]] or [[cooking range]], two options of cooking are given: poorly or thoroughly. Cooking poorly requires 1 [[Cooking]], but yields a [[poison karambwan]] and 80 Cooking experience. Cooking thoroughly requires 30 Cooking yielding a [[cooked karambwan]] and 190 Cooking experience. Poison karambwan cannot be cooked again to obtain a cooked karambwan. Karambwan stop burning at 99 Cooking, 93 Cooking at the [[Hosidius Kitchen]], or 87 Cooking at the Hosidius Kitchen after completing the [[elite Kebos Diary]].

Catching a karambwan is a [[medium Karamja Diary]] task, while [[Cooking]] a karambwan thoroughly is a [[hard Karamja Diary]] task.

Raw karambwan can be purchased from [[Tiadeche's Karambwan Stall]], which has a fast restock rate. Cooking karambwan by buying them is a popular Cooking method for [[Ultimate ironman]] players.

